import React, { Component }     from 'react';
import { connect }              from 'react-redux';
import { searchModalOpen, searchModalClose } from'../../Reducers';
import {withRouter} from 'react-router-dom';
import { Fab, Dialog, DialogContent, TextField } from '@material-ui/core'
import './fab.scss'



 class SearchFab extends Component{ 
    constructor(props){
        super(props);
        this.state={

         };

         this.setSearch = this.setSearch.bind(this)

    }

    setSearch( value ) {

        switch(value){
            case 'open':
                return this.props.searchModalOpen()
            break;

            case 'close':
                return this.props.searchModalclose()
        }
    }

    render() {
        const { isOpen } = this.props
        console.log(isOpen)
        const searchBar = <Dialog 
                            open={isOpen} 
                            onClose={ this.setSearch('close') } 
                            aria-labelledby="form-dialog-title"
                            >
                            <DialogContent>
                            <TextField
                                autoFocus
                                margin="dense"
                                id="name"
                                label="Email Address"
                                type="email"
                                fullWidth
                            />
                            </DialogContent>
                        </Dialog>


        return(
            <div className = 'fabloc'>
               <Fab className='fab' onClick = { () => { this.setSearch('open') }}>
                <i className="material-icons">
                    search
                </i>
               </Fab>

                { searchBar }

            </div>

        );
    }
}
const mapStateToProps = state => {
    const isOpen = state.search_Model.isOpen;

        return{ isOpen };
}

const mapDispatchToProps = (dispatch) => {
    return{
        searchModalOpen:(data) => dispatch( searchModalOpen(data)),
        searchModalClose:(data) => dispatch( searchModalClose(data))
    };
};

export default withRouter(connect(mapStateToProps, mapDispatchToProps )(SearchFab))
